import React from 'react';

const Calendar = () => {
  return (
    <div>
      <h2>My Google Calendar</h2>
      <iframe src="https://calendar.google.com/calendar/embed?src=emiller3425%40gmail.com&ctz=America%2FDetroit" style="border: 0" width="800" height="600" frameborder="0" scrolling="no"></iframe>
    </div>
  );
};

export default Calendar;
